let width=window.innerWidth/100,height=window.innerHeight/100
export const responsive={
    hosting_header:function(){
        let style={
            top:`${40*height}px`,
            position:'relative',
            width:`${10*width}px`,
            height:`${5*height}px`,
            left:`${30*width}px`
        }
        return style
    }
}
